import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import Main from "../pages/main";
import LoginUser from "../pages/loginUser"
import RegisterUser from "../pages/registerUser";
import RegisterAdress from "../pages/registerAdress";
import InfoUser from "../pages/infoUser";
import PedidosUser from "../pages/pedidosUser";

const Private =({ Item })

const RoutesPage = () => {
    return(    
        <BrowserRouter>
         
            <Routes>
                <Route exact path="/" element = { <Main /> }  />
                <Route exact path="/loginUser" element = {<LoginUser />} />
                <Route exact path="/registerUser" element = {<RegisterUser />} />
                <Route exact path="/registerAdress" element = {<RegisterAdress />} />
                <Route exact path="/infoUser" element = {<InfoUser />} />
                <Route exact path="/localPedidos" element = {<PedidosUser />} />
                <Route path="*" element = { <Main /> }  />
            </Routes>
          
        </BrowserRouter>
    )
}

export default RoutesPage;
